import Card from './Card'
import styles from '../scss/css_components/'

function Lista({ data }){
    return(
        <>
       <div class="lista">
           {data.map((item, index)=>(
                <Card
                    nome_site={item.id}
                    desc_site={item.body_text}
                    link_site={item.a_link}
                    link_img={item.url_img}
                />
           ))}
       </div>
        </>
    )
}

export default Lista

